import {Axios} from "@/services/axios.js"

export default{
    async RegisterUser(data){
        try {
            await Axios.post('users',data)
            .then(response => {
                return response.data
            })
            .catch(e => {
                return e.messages
            })
        } catch (error) {
            return error
        }
    },
    async RegisterUser(data){
        try {
            await Axios.post('users',data)
            .then(response => {
                return response.data
            })
            .catch(e => {
                return e.messages
            })
        } catch (error) {
            return error
        }
    }
}
